  <body>
    <div class="react-bootstrap-element"></div>
    <script type="text/javascript">
      if (typeof Object.assign != 'function') {
        (function () {
          Object.assign = function (target) {
            'use strict';
            if (target === undefined || target === null) {
              throw new TypeError('Cannot convert undefined or null to object');
            }

            var output = Object(target);
            for (var index = 1; index < arguments.length; index++) {
              var source = arguments[index];
              if (source !== undefined && source !== null) {
                for (var nextKey in source) {
                  if (Object.prototype.hasOwnProperty.call(source, nextKey)) {
                    output[nextKey] = source[nextKey];
                  }
                }
              }
            }
            return output;
          };
        })();
      }
    </script>
    <script type="text/javascript" src="/build/misc/prism.js"></script>
    <script type="text/javascript" src="/build/misc/holder.js"></script>
    <script type="text/javascript" src="/build/misc/ua-parser.js"></script>
    <script type="text/javascript">
      window.userAgentDetails = new UAParser();

      if(window.userAgentDetails.getOS().name === 'iOS') {
        document.querySelector('body').style.cursor = 'pointer';
      }
    </script>
    <script type="text/javascript" src="/build/locale/en-i18n.js"></script>
    <script type="text/javascript" src="/build/libraries-core.js"></script>

    <script type="text/javascript" src="/build/mocked-local-storage.js"></script>
    <script type="text/javascript" src="/build/application.js"></script>
  </body>
